function Continue() {
  return (
    <>
      <div class="flex gap-2 mt-2">
        <button class="font-Poppins bg-[#2D429B] h-[34px] rounded-lg font-medium">
          <span class="text-white py-[10px] px-[16px]">
            Continue assessment
          </span>
        </button>
      </div>
    </>
  );
}

export default Continue;
